 @Oni_Manga_Land  I wouldn't blame her. I don't think any member of hololive (or any vtuber in general) would be ready to be known as the "biggest vtuber in the world." It's one of those titles that come with so much pressure.

You know, I still remember some advice Gura gave us that I'll always remember, and I hope she can follow her own advice too. "Stop giving a damn. Have fun in the way you want to have fun, and don't care what anyone else says or thinks, because you're living for you and not for anyone else."

I would go far enough to say this applies to fans too. I don't mean ignore the fans outright, but she should make herself the priority in terms of health and care. After all, a sad shark means sad fans.
